import React from "react";

const Footer = () => (
  <footer className="bg-dark p-3 text-center">
    <div className="logo" />
    <p>
      <a href="https://github.com/RachelHamiltonWorks/giphtionary">
        Repository
      </a>
    </p>
  </footer>
);

export default Footer;
